import Login from "./Login";

import { auth } from "../firebaseConfig/firebaseConfig";

const Nav = () => {
    console.log(auth.currentUser)
    return ( 
        <div className="nav">
            <ul>
                {auth.currentUser ? "Signed up" : <Login/>}
            </ul>
        </div>
     );
}

export default Nav;
